{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/lilliankaiser/bike-share-r-language?scriptVersionId=234877645\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"26749d80","metadata":{"papermill":{"duration":0.012745,"end_time":"2025-04-19T17:01:27.85542","exception":false,"start_time":"2025-04-19T17:01:27.842675","status":"completed"},"tags":[]},"source":["# **Cyclistic Bikeshare - Google Capstone Project in R language**\"\n","### Author: \"Lillian Kaiser\"\n","### Date: \"September 2023\"\n","### Output: html_document\n","---\n","\n","## **Case Background:**\n","\n","#### In this case study, the business task is to analyze historical bike trip data of Cyclistic, a bike-share company in Chicago, to understand how casual riders and annual members use Cyclistic bikes differently. Cyclistic operates a successful bike-share business with 5,824 bicycles and 692 stations in Chicago. The company offers two membership types:\n","\n","#### •\tCasual Riders: These are customers who purchase single-ride or full-day passes, indicating they use the service infrequently or on a pay-as-you-go basis.\n","\n","#### •\tAnnual Members: These are subscribers who pay for annual memberships, providing them with unlimited access to the bikes throughout the year.\n","\n","#### The primary objective is to gain insights from the data that will help the marketing team develop a new strategy to convert casual riders into annual members. To do this, the analysis will likely involve examining various aspects of bike usage by both types of customers, including ride frequency, trip duration, and popular riding days. The findings can be used to tailor marketing strategies that encourage casual riders to become annual members and thereby increase the company's recurring revenue."]},{"cell_type":"markdown","id":"6aba6602","metada