Summer\" = \"yellow\", \"Fall\" = \"orange\")) +\n","  theme_minimal(base_size = 13) +\n","  theme(\n","    panel.border = element_rect(color = \"black\", fill = NA, linewidth = 1),\n","    plot.title = element_text(hjust = 0.5, face = \"bold\"),\n","    plot.subtitle = element_text(hjust = 0.5),\n","    axis.text.x = element_text(angle = 45, hjust = 1)\n","  )\n"]},{"cell_type":"markdown","id":"936a07ce","metadata":{"papermill":{"duration":0.018508,"end_time":"2025-04-19T17:08:47.265568","exception":false,"start_time":"2025-04-19T17:08:47.24706","status":"completed"},"tags":[]},"source":["#### Rides by Weekday and Rider Type"]},{"cell_type":"markdown","id":"2dc0fa30","metadata":{"papermill":{"duration":0.018302,"end_time":"2025-04-19T17:08:47.302408","exception":false,"start_time":"2025-04-19T17:08:47.284106","status":"completed"},"tags":[]},"source":["#### Average Ride Length by Member Type and Weekday"]},{"cell_type":"code","execution_count":28,"id":"a9f8a3f1","metadata":{"execution":{"iopub.execute_input":"2025-04-19T17:08:47.344495Z","iopub.status.busy":"2025-04-19T17:08:47.3429Z","iopub.status.idle":"2025-04-19T17:08:48.53216Z","shell.execute_reply":"2025-04-19T17:08:48.530306Z"},"papermill":{"duration":1.213444,"end_time":"2025-04-19T17:08:48.534435","exception":false,"start_time":"2025-04-19T17:08:47.320991","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wT9R/H8c9lNt0LWii77A0CMmQIKoqA4yfiYjhAFFxsRUXF/VNEEURx4M89\ncYKboQwVcbL33m3pSpO0ud8fwdJFei1Nrlxez0f/aC6X+36+N5p3byqqqgoAAADOfCa9CwAA\nAEDVINgBAAAYBMEOAADAIAh2AAAABkGwAwAAMAiCHQAAgEEQ7AAAAAyCYAcAAGAQZ3CwU705\nTcNtiqKYzLY12R69y9FBqwibUorJZImKrdGh54CHX/7GW2Tk3+5uryjKRcv2+5/mM6lxiqIs\nSs87ncJyDsxRFCUs5pzTmUgQbHm9l6IovV7fUtEP3pYSpSjKRmd+IKqqtou1TL/c1aZ0taUN\n/vNIlTddrZQ7h0vPE4s9MqVhs8tvnPT5X8eCWaoWuQeXXN/vrMRIW1Kre8ocYdcXFyqKYg1v\n4i311o/DmyqKYg1v7C518/tVt7RUFCW67sQqLPW1ZgmKorx9JLcKpwmc0Sx6F1B5x/6eusXp\nERHV